CREATE TABLE `departamentos` (
  `id_codDepartamento` bigint unsigned NOT NULL AUTO_INCREMENT,
  `st_nomeDepartamento` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`id_codDepartamento`)
);

CREATE TABLE `disciplinas` (
  `id_codDisciplina` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `st_nomeDisciplina` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `id_codDepartamento` bigint unsigned NOT NULL,
  PRIMARY KEY (`id_codDisciplina`),
  KEY `DB_id_coddepartamento_foreign` (`id_codDepartamento`),
  CONSTRAINT `DB_id_coddepartamento_foreign` FOREIGN KEY (`id_codDepartamento`) REFERENCES `departamentos` (`id_codDepartamento`)
);

CREATE TABLE `professores` (
  `st_nomeProfessor` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `id_codDepartamento` bigint unsigned NOT NULL,
  PRIMARY KEY (`st_nomeProfessor`),
  KEY `professores_id_coddepartamento_foreign` (`id_codDepartamento`),
  CONSTRAINT `professores_id_coddepartamento_foreign` FOREIGN KEY (`id_codDepartamento`) REFERENCES `departamentos` (`id_codDepartamento`)
);

CREATE TABLE `turmas` (
  `id_turma` bigint unsigned NOT NULL AUTO_INCREMENT,
  `st_turma` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `st_nomeProfessor` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `st_horario` varchar(300) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `int_vagasOcupadas` int DEFAULT NULL,
  `int_totalVagas` int DEFAULT NULL,
  `st_local` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `id_codDisciplina` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `st_periodoLetivo` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id_turma`),
  KEY `st_nomeProfessor` (`st_nomeProfessor`),
  CONSTRAINT `st_nomeProfessor` FOREIGN KEY (`st_nomeProfessor`) REFERENCES `professores` (`st_nomeProfessor`)
);

CREATE TABLE `users` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `email` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `password` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `bl_admin` int NOT NULL DEFAULT '0',
  `st_curso` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `matricula` bigint DEFAULT NULL,
  `bl_ativo` int DEFAULT '1',
  PRIMARY KEY (`id`),
  UNIQUE KEY `users_email_unique` (`email`)
);

CREATE TABLE `personal_access_tokens` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `tokenable_type` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `tokenable_id` bigint unsigned NOT NULL,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `token` varchar(64) COLLATE utf8mb4_unicode_ci NOT NULL,
  `abilities` text COLLATE utf8mb4_unicode_ci,
  `last_used_at` timestamp NULL DEFAULT NULL,
  `expires_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `personal_access_tokens_token_unique` (`token`),
  KEY `personal_access_tokens_tokenable_type_tokenable_id_index` (`tokenable_type`,`tokenable_id`),
  KEY `tokenable_id_idx` (`tokenable_id`),
  CONSTRAINT `tokenable_id` FOREIGN KEY (`tokenable_id`) REFERENCES `users` (`id`)
) ;

CREATE TABLE `avaliacoes` (
  `id_avaliacao` bigint unsigned NOT NULL AUTO_INCREMENT,
  `int_estrelas` int NOT NULL,
  `st_avaliacao` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `id_usuario` bigint unsigned NOT NULL,
  `id_turma` bigint unsigned DEFAULT NULL,
  `dt_cadastro` date NOT NULL,
  `st_nomeProfessor` varchar(245) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id_avaliacao`),
  KEY `avaliacoes_id_usuario_foreign` (`id_usuario`),
  KEY `professores_st_nomeProfessores_foreign` (`st_nomeProfessor`),
  KEY `avaliacoes_id_turma_foreign` (`id_turma`),
  CONSTRAINT `avaliacoes_id_turma_foreign` FOREIGN KEY (`id_turma`) REFERENCES `turmas` (`id_turma`),
  CONSTRAINT `avaliacoes_id_usuario_foreign` FOREIGN KEY (`id_usuario`) REFERENCES `users` (`id`),
  CONSTRAINT `professores_st_nomeProfessores_foreign` FOREIGN KEY (`st_nomeProfessor`) REFERENCES `professores` (`st_nomeProfessor`)
);

CREATE TABLE `denuncias` (
  `id_denuncia` bigint unsigned NOT NULL AUTO_INCREMENT,
  `id_usuario` bigint unsigned NOT NULL,
  `id_avaliacao` bigint unsigned NOT NULL,
  `dt_cadastro` date NOT NULL,
  PRIMARY KEY (`id_denuncia`),
  KEY `denuncias_id_usuario_foreign` (`id_usuario`),
  KEY `denuncias_id_avaliacao_foreign` (`id_avaliacao`),
  CONSTRAINT `denuncias_id_avaliacao_foreign` FOREIGN KEY (`id_avaliacao`) REFERENCES `avaliacoes` (`id_avaliacao`),
  CONSTRAINT `denuncias_id_usuario_foreign` FOREIGN KEY (`id_usuario`) REFERENCES `users` (`id`)
);
    
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `DeletarUsuario`(
	IN id_denuncia INT,
	IN id_avaliacao INT,
	IN id_usuario INT
)
BEGIN
    DELETE FROM denuncias WHERE id_denuncia = id_denuncia;
DELETE FROM avaliacoes 
WHERE
    id_avaliacao = id_avaliacao;
UPDATE users 
SET 
    bl_ativo = 0
WHERE
    id = id_usuario;
END ;;
DELIMITER ;


CREATE VIEW vw_denunciasprofessores AS
SELECT 
        `d`.`id_denuncia` AS `id_denuncia`,
        `u`.`name` AS `UserDenunciadoNome`,
        `u`.`email` AS `UserDenunciadoEmail`,
        `u`.`matricula` AS `UserDenunciadoMatricula`,
        `u`.`id` AS `UserDenunciadoID`,
        `a`.`id_avaliacao` AS `id_avaliacao`,
        `a`.`st_avaliacao` AS `st_avaliacao`,
        `a`.`int_estrelas` AS `int_estrelas`,
        `depar`.`id_codDepartamento` AS `id_codDepartamento`,
        `depar`.`st_nomeDepartamento` AS `st_nomeDepartamento`,
        `p`.`st_nomeProfessor` AS `st_nomeProfessor`
    FROM
        ((((`denuncias` `d`
        JOIN `avaliacoes` `a` ON ((`a`.`id_avaliacao` = `d`.`id_avaliacao`)))
        JOIN `users` `u` ON ((`u`.`id` = `a`.`id_usuario`)))
        JOIN `professores` `p` ON ((`p`.`st_nomeProfessor` = `a`.`st_nomeProfessor`)))
        JOIN `departamentos` `depar` ON ((`p`.`id_codDepartamento` = `depar`.`id_codDepartamento`)));

CREATE VIEW vw_denunciasturmas AS
    SELECT 
        `d`.`id_denuncia` AS `id_denuncia`,
        `u`.`name` AS `UserDenunciadoNome`,
        `u`.`email` AS `UserDenunciadoEmail`,
        `u`.`matricula` AS `UserDenunciadoMatricula`,
        `u`.`id` AS `UserDenunciadoID`,
        `a`.`id_avaliacao` AS `id_avaliacao`,
        `a`.`st_avaliacao` AS `st_avaliacao`,
        `a`.`int_estrelas` AS `int_estrelas`,
        `dis`.`id_codDisciplina` AS `id_codDisciplina`,
        `dis`.`st_nomeDisciplina` AS `st_nomeDisciplina`,
        `depar`.`id_codDepartamento` AS `id_codDepartamento`,
        `depar`.`st_nomeDepartamento` AS `st_nomeDepartamento`,
        `t`.`st_turma` AS `st_turma`,
        `t`.`st_periodoLetivo` AS `st_periodoLetivo`
    FROM
        (((((`denuncias` `d`
        JOIN `avaliacoes` `a` ON ((`a`.`id_avaliacao` = `d`.`id_avaliacao`)))
        JOIN `users` `u` ON ((`u`.`id` = `a`.`id_usuario`)))
        JOIN `turmas` `t` ON ((`t`.`id_turma` = `a`.`id_turma`)))
        JOIN `disciplinas` `dis` ON ((`dis`.`id_codDisciplina` = `t`.`id_codDisciplina`)))
        JOIN `departamentos` `depar` ON ((`depar`.`id_codDepartamento` = `dis`.`id_codDepartamento`)));

CREATE VIEW vw_turmasavaliacao AS
    SELECT 
        `t`.`id_turma` AS `id_turma`,
        `t`.`st_turma` AS `st_turma`,
        `t`.`st_periodoLetivo` AS `st_periodoLetivo`,
        `t`.`st_nomeProfessor` AS `st_nomeProfessor`,
        `t`.`st_horario` AS `st_horario`,
        `t`.`st_local` AS `st_local`,
        `dis`.`id_codDisciplina` AS `id_codDisciplina`,
        `dis`.`st_nomeDisciplina` AS `st_nomeDisciplina`,
        `dep`.`st_nomeDepartamento` AS `st_nomeDepartamento`,
        `dep`.`id_codDepartamento` AS `id_codDepartamento`,
        `ava`.`id_avaliacao` AS `id_avaliacao`,
        `ava`.`int_estrelas` AS `int_estrelas`,
        `ava`.`st_avaliacao` AS `st_avaliacao`,
        `ava`.`id_usuario` AS `id_usuario`,
        `den`.`id_avaliacao` AS `id_denuncia`
    FROM
        ((((`turmas` `t`
        JOIN `disciplinas` `dis` ON ((`t`.`id_codDisciplina` = `dis`.`id_codDisciplina`)))
        JOIN `departamentos` `dep` ON ((`dep`.`id_codDepartamento` = `dis`.`id_codDepartamento`)))
        LEFT JOIN `avaliacoes` `ava` ON ((`ava`.`id_turma` = `t`.`id_turma`)))
        LEFT JOIN `denuncias` `den` ON ((`ava`.`id_avaliacao` = `den`.`id_avaliacao`)));

